import Weather from "./Components/Weather/Weather";
import { Switch, Route } from "react-dom";

function App() {
  return (
    <div className="App">
      <Switch>
        <Route exact path="/" component={Weather} />
      </Switch>
    </div>
  );
}

export default App;
